import React from 'react'
import {
    Box
} from '@chakra-ui/react'

const Home = () => {
  return (
    <Box bg='tomato' w='100%' marginLeft = '10%' p={4} color='white'>
        This is the Box
    </Box>
    )
}

export default Home
